import React from "react";
import "./LandingPage.css";
import Background from "../images/socialBackground.jpg";

function LandingPage() {
  return (
    <div className="landingPage">
      <div className="landingPage_title">Welcome to Edsbook!</div>
      <div>
        <img src={Background} />
      </div>
    </div>
  );
}

export default LandingPage;
